import "./App.css";
import CardList from "./components/cards/CardList";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>Welcome to Piggy bank</h1>
        <p>Please Login to proceed</p>
      </header>
      <CardList />
      <div style={{ marginBottom: 80 }} />
    </div>
  );
}

export default App;
